const Favourites = () =>{
    const favourites = useSelector((state) => state.myFavourites)
    return(
        <>
        {
            favourites.map(({id,name,status,gender,species,origin,image}) => {
                return <Card
                key={id}
                id={id}
                name={name}
                status={status}
                species={species}
                gender={gender}
                origin={origin.name}
                image={image}
                />;
            })
        }
        </>
    )
}

export default Favourites;
